events.predicate:
var holder = container.find("#cpf_holder_nd");
var dependent = container.find("#cpf_dependent_nd")
return "holder = " + holder.val() + " & dependent = " + dependent.val()

var cpf = container.find("#cpf_deposit");
var amount = container.find("#amount_deposit")
return "cpf = " + cpf.val() + " & amount = " + amount.val()

var cpf = container.find("#cpf_withdraw");
var amount = container.find("#amount_withdraw")
return "cpf = " + cpf.val() + " & amount = " + amount.val()

var from = container.find("#from_transfer");
var to = container.find("#to_transfer")
var amount = container.find("#amount_transfer")
return "from = " + from.val() + " & to = " + to.val() + " & amount = " + amount.val()

var name = container.find("#name");
var nr = container.find("#nr"); 
return "name = " + name.val() + " & nr = " + nr.val();

data.label:
if(event.canExecute) {
  return '<span>Search for ' + event.predicate + ' in phonebook.</span>';
} else {
  return '<span>' + event.predicate + ' not in phonebook.</span>';
}
